import React from "react";
import plate2 from './imgs/plate2.svg'

const ReadyToCock =() =>{
    return (
        <div class="md:h-[40vh] lg:h-[70vh] h-[30%] mt-12 w-[96%] ml-[2%] pt-10 grid grid-flow-col">
            <div clas="w-[50vw]">
                <img src={plate2} class="w-[50vw] bg-white h-[100%]" alt="img"></img>
            </div>
            <div clas="w-[50vw]">
                <p>Ready To Cock ?</p>
                <p>Get our latest Recipies and our expert tips right in your inbox</p>
                <div>
                    <input type="submit"></input>
                </div>
            </div>
        </div>
    )
}
export default ReadyToCock;
